-- nba_games table
drop table if exists nba_games;
CREATE TABLE nba_games (
    game_id varchar(255) PRIMARY KEY,
    game_date DATE NOT NULL,
    home_team_id INT,
    home_team_points INT, -- maybe remove this
    visiting_team_id INT,
    visiting_team_points INT -- maybe remove this
);
-- insert into nba_games values ();

-- relationship between player_season and game table
drop table if exists player_season_per_game;
CREATE TABLE player_season_per_game (
    player_id INT NOT NULL,
    season_id VARCHAR(255) NOT NULL,
    game_id varchar(255) NOT NULL,
    player_minutes int default 0,
    player_points INT DEFAULT 0,
	player_fg_percent FLOAT DEFAULT 0.0,
    player_rebounds INT DEFAULT 0,
    player_assists INT DEFAULT 0,
    player_steal int default 0,
    player_block int default 0,
    player_turnover int default 0,
    PRIMARY KEY (player_id , season_id , game_id),
    FOREIGN KEY (player_id)
        REFERENCES player_season (player_id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (season_id)
        REFERENCES player_season (season_id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (game_id)
        REFERENCES nba_games (game_id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);
-- insert into player_season_per_game values ();

-- relationship between team_season and game table
drop table if exists team_season_per_game;
CREATE TABLE team_season_per_game (
    team_id INT NOT NULL,
    season_id VARCHAR(255) NOT NULL,
    game_id varchar(255) NOT NULL,
    team_points INT DEFAULT 0,
	team_fg_percent FLOAT DEFAULT 0.0,
    team_rebounds INT DEFAULT 0,
    team_assists INT DEFAULT 0,
    team_steal int default 0,
    team_block int default 0,
    team_turnover int default 0,
    PRIMARY KEY (team_id , season_id , game_id),
    FOREIGN KEY (team_id)
        REFERENCES team_season (team_id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (season_id)
        REFERENCES team_season (season_id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (game_id)
        REFERENCES nba_games (game_id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);
-- insert into team_season_per_game values ();

