delimiter $$
create procedure get_team_roster(in team_id_p int, in season_id_p varchar(255))
begin
	select distinct nba_players.player_id as player_id, nba_players.first_name as first_name, nba_players.last_name as last_name
	from player_team_season inner join nba_players
	on player_team_season.player_id = nba_players.player_id
	where player_team_season.season_id = season_id_p and player_team_season.team_id = team_id_p;
end$$
delimiter ;
